import React from "react";
import './CoinCourse.css';

async function getBitcoin() {
    let response = await fetch('https://translated.turbopages.org/proxy_u/en-ru.ru.598e5abb-6375458d-5cb2d57c-74722d776562/https/api.binance.com/api/v3/ticker/price?symbol=BTCUSDT');
    let bitcoin = await response.json();
    return bitcoin.price;
}

export default getBitcoin;
